import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Projects from "./components/Projects";
import ProjectRacc from "./components/projects/ProjectRacc";
import Skills from "./components/Skills";
import Resume from "./components/Resume";
import Fun from "./components/Fun";
import Contact from "./components/Contact"; // Import the new contact page
import Cursor from "./components/Cursor";
import './App.css';
import './index.css';

const App = () => {
  const [showNavbar, setShowNavbar] = useState(false);

  return (
    <Router>
      <div className="overflow-y-auto h-screen">
        {showNavbar && <Navbar />}
        <Cursor /> 

        <Routes>
          <Route path="/" element={<Hero setShowNavbar={setShowNavbar} />} />
          <Route path="/hero" element={<Hero setShowNavbar={setShowNavbar} />} />
          <Route path="/projects" element={<Projects />} />
          <Route path="/projects/racctracc" element={<ProjectRacc />} />
          <Route path="/skills" element={<Skills />} />
          <Route path="/resume" element={<Resume />} />
          <Route path="/fun" element={<Fun />} />
          <Route path="/contact" element={<Contact />} />  {/* New route for contact */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
